Yayva River (Russian: Яйва) is a river in Perm Krai, Russia, left tributary of Kama River. It is 304 kilometers (189 mi) in length. The area of the basin is 6,250 square kilometers (2,410 sq mi). It starts on south slope of mountain range Kvarkush, 710 m above sea level, near the border with Sverdlovsk Oblast. It flows into Kama Reservoir, lower town Berezniki and opposite of settlement Oryol, forming a bay. It is a mountain river upstream with many rifts and rapids; downstream it is a flat river. Main tributaries: 
* Left: Kad, Chikman, Chanva, Vilva, Usolka; 
* Right: Ulvich, Ik.
